import React from 'react';
import { Link } from 'react-router-dom';
const Header = () => {
  return (
    <div className="ui secondary pointing menu">
      <Link to="/pages/videos" className="item">
        Videos
      </Link>
      <Link to="/pages/videos" className="item">
        Photos
      </Link>
      <Link to="/pages/musique" className="item">
        Music
      </Link>
      <div className="right menu">
        <Link to="/pages/bio" className="item">
          Bio
        </Link>
      </div>
      <img src="" alt="msniccki_header" />
    </div>
  );
};

export default Header;
